import React from 'react';
import './App.css';
import SearchBox from './SearchBox.js'; // Ensure this path is correct

function App() {
  return (
    <div className="hero-section">
      <header>
        <div className="logo">Ascenda</div>
        <nav>
          <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#about">About</a></li>
            <li><a href="#login">Login</a></li>
          </ul>
        </nav>
      </header>
      <div className="content">
        <h1>Get Ready to Explore the World with <span>Ascenda</span></h1>
        <SearchBox />
      </div>
    </div>
  );
}

export default App;
